import React, { Component } from 'react';

class App22 extends Component {
    render() {
        var hour = new Date().getHours();

        if (hour >= 8 && hour <= 10) {
            //At GYM
            return (
                <div>
                    <p>At gym</p>
                </div>
            );
        } else if (hour >= 11 && hour <= 17) {
            //LEARNING
            return (
                <div>
                    <p>Learning</p>
                </div>

            );
        } else if (hour >= 18 && hour <= 21) {
            return (
                <div>
                    <p>Hobbies/Relaxation</p>
                </div>
            );
        } else {
            //SLEEPING
            return (
                <div>
                    <p>Sleeping</p>
                </div>
            )
        }
    }

}

export default App22;
